import React, { Component } from 'react'
import PropTypes from 'prop-types'
import ReactDataGrid from 'react-data-grid'

// import InfoCardSource from './InfoCardSource'
// import './index.css'
import { connect } from 'react-redux'
import { withRouter } from 'react-router-dom'
// import cx from 'classnames'


class LisenceTable extends Component {
  createRows = (data) => {
    this._rows = data
  }

  rowGetter = (i) => {
    return this._rows[i]
  }

  render () {
    this.createRows(this.props.data)
    return (
      <div className={cx('infoCard', 'Lisence Table')}>
        <div className='datasetsPrimary'>
          <div>
            <ReactDataGrid
              columns   ={this.props.columns}
              rowGetter ={this.rowGetter}
              rowsCount ={this.props.data.length || 0}
              minHeight ={500}
            />
          </div>
        </div>
        {/* <InfoCardSource /> */}
      </div>
    )
  }
}

LisenceTable.propTypes = {
  data: PropTypes.array,
  columns: PropTypes.array
}

const mapStateToProps = ({ licMan }) => {
  return {
      licMan
    }
}
export default withRouter(connect(
  mapStateToProps,
  {

  }
)(LisenceTable))
